var resetForm=function resetForm(g){stopPropagation(g);document.getElementById("file-form")["reset"]();var f=document.getElementById("file-disclaimer");if(f!==null){if(f.className===""){f.className="hidden"}}var c=document.getElementById("file-error");var b=document.getElementById("file-info");if(c!==null&&c.className===""){c.className="hidden"}b.innerHTML=fileSize+"MB max.";var a=document.getElementById("file-icon");a.className="fa fa-angle-double-up";var d=g.target;d.checked=true};var readFile=function readFile(i){stopPropagation(i);var j=i.target;if(j.files&&j.files.length>0){var g=j.files[0];var k=document.getElementById("file-icon");var b=document.querySelector('input[type="radio"]:checked')["value"];var m="";var h=false;if((g.size/1024/1024)<fileSize){if(b==="shp"&&g.type==="application/zip"){m="fa fa-file-archive-o"}else{if(b==="kml"&&g.type==="application/vnd.google-earth.kml+xml"){m="fa fa-file-text-o"}else{if(b==="geojson"&&g.type==="application/json"){m="fa fa-file-code-o"}else{if(b==="csv"&&g.type==="text/csv"){m="fa fa-file-excel-o"}else{h=true}}}}}else{h=true}if(h===true){document.getElementById("file-form")["reset"]();m="fa fa-close"}k.className=m;var d=document.getElementById("file-disclaimer");if(d!==null){if(d.className==="hidden"){d.className=""}}var a=document.getElementById("file-error");var f=document.getElementById("file-info");if(h===true){if(a!==null&&a.className==="hidden"){a.className=""}if(f!==null&&f.className===""){f.className="hidden"}}else{if(a!==null&&a.className===""){a.className="hidden"}if(f!==null){if(f.className==="hidden"){f.className=""}var c=g.name;var l=c.split(".").pop();if(c.length>21){c=c.slice(0,21-l.length)+" ..."+l}f.innerHTML=c}}}};ready(function(){var b=document.getElementById("file-chooser");if(b!==null){addListener(b,"change",readFile)}var c=document.getElementsByClassName("file-radio");if(c!==null){for(var a=0;a<c.length;a++){addListener(c[a],"change",resetForm)}}});